import "./Cell_styles.scss";
import Tilt from "react-vanilla-tilt";
import React, { useState } from "react";

const Cell = ({ cellClass }) => {
  const [checked, setChecked] = useState(false);
  const [text, setText] = useState("This is the Cell txt");

  return (
    <Tilt options={{ scale: 2, max: 25 }}>
      <div
        className={cellClass}
        onClick={() => {
          if (checked === false) {
            setChecked(true);
            setText("I was checked");
          } else {
            return;
          }
        }}
      >
        <p className="cell_text">{text}</p>
      </div>
    </Tilt>
  );
};

export default Cell;
